import { IonCol, IonContent, IonGrid, IonHeader, IonPage, IonRouterLink, IonRow, IonSelect, IonSelectOption, IonText, IonTitle } from '@ionic/react';
import React from 'react';

import '../../css/Global.css';
import '../../css/Study@SIM.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAddressBook, faCommentAlt, faFileAlt, faQuestionCircle } from '@fortawesome/free-solid-svg-icons';

import TopNav from '../../components/TopNav';
import Menu from '../../components/Menu';


const StudySIMMain: React.FC = () => {

    return (
        <IonPage>
            <IonHeader>
                <TopNav title="Study@SIM" route='/u/home' backarrow={ true } hamburger = { true }/>
            </IonHeader>

            <IonContent fullscreen={true}>
                <IonGrid id="studySIMMainGrid">
                    <IonRow class="ion-align-items-center">
                        <IonCol class="ion-text-center">
                            <IonRow>
                                <IonTitle className="studySIMMainTitle">I am looking for</IonTitle>
                            </IonRow>

                            <IonRow>
                                <IonSelect id="highestQualSelect" className="readOnlyIonInput" name="highestQualification" value={highestQualification} disabled={highestQualDisabled} ref={register({ required: true })}>
                                    <IonSelectOption value="aLevel" className="highestQualSelectOption">'A' Level</IonSelectOption>
                                    <IonSelectOption value="oLevel" className="highestQualSelectOption">'O' Level</IonSelectOption>
                                    <IonSelectOption value="degree" className="highestQualSelectOption">Degree</IonSelectOption>
                                    <IonSelectOption value="diploma" className="highestQualSelectOption">Diploma</IonSelectOption>
                                </IonSelect>
                            </IonRow>

                        </IonCol>
                    </IonRow>

                </IonGrid>
            </IonContent>
        </IonPage>
    );
};

export default StudySIMMain;
